% %%
% matlabbatch{2}.spm.util.dicom.root = 'flat';
% matlabbatch{2}.spm.util.dicom.outdir = {'/Users/orlando/Documents/MATLAB/TESIS/test/sb1/TEMP'};
% matlabbatch{2}.spm.util.dicom.protfilter = '.*';
% matlabbatch{2}.spm.util.dicom.convopts.format = 'nii';
% matlabbatch{2}.spm.util.dicom.convopts.icedims = 0;
%% 

for  i=1: 6%length(subjects)
%i=6;
            clear matlabbatch;
            clear name_files_dcm;
            clear n_files;
            matlabbatch = cell(1,1);
           av_files = dir(fullfile(matlabroot,subjects{i},'DICOM'));
           dcm_files=spm_select('List',fullfile(matlabroot,subjects{i},'DICOM',av_files(3,1).name),'.*');
           n_files = dir(fullfile(matlabroot,subjects{i},'DICOM',av_files(3,1).name));
             for k=1: length(n_files)-2
                 name_files_dcm(k,:)=fullfile(matlabroot,subjects{i},'DICOM',av_files(3,1).name,dcm_files(k,:));
             end
matlabbatch{1}.spm.util.dicom.data = cellstr(name_files_dcm);

%%
matlabbatch{1}.spm.util.dicom.root = 'flat';
matlabbatch{1}.spm.util.dicom.outdir = {fullfile(matlabroot,subjects{i},'TEMP')};
%matlabbatch{1}.spm.util.dicom.outdir = {'E:\Copias\francis\Orlando\tesis\test\sb1\TEMP4\'};
matlabbatch{1}.spm.util.dicom.convopts.format = 'nii';
matlabbatch{1}.spm.util.dicom.convopts.icedims = 0;
clear name_files_dcm;
clear n_files;
%%
            n_files2 = dir(fullfile(matlabroot,subjects{i},'DICOM',av_files(4,1).name));
           dcm_files=spm_select('List',fullfile(matlabroot,subjects{i},'DICOM',av_files(4,1).name),'.*');
             for h=1: length(n_files2)-2
                 name_files_dcm(h,:)=fullfile(matlabroot,subjects{i},'DICOM',av_files(4,1).name,dcm_files(h,:));
             end
matlabbatch{2}.spm.util.dicom.data = cellstr(name_files_dcm);

%%
matlabbatch{2}.spm.util.dicom.root = 'flat';
matlabbatch{2}.spm.util.dicom.outdir ={fullfile(matlabroot,subjects{i},'TEMP')};
%matlabbatch{2}.spm.util.dicom.outdir = {'E:\Copias\francis\Orlando\tesis\test\sb1\TEMP4\'};
matlabbatch{2}.spm.util.dicom.convopts.format = 'nii';
matlabbatch{2}.spm.util.dicom.convopts.icedims = 0;
    try
        i
        spm_jobman('serial',matlabbatch); %run the previously prepared spm task in batch serial mode
    catch
        fprintf('error during IMPORT %s\n',fullfile(matlabroot,subjects{i}))
    end
end
